function [A, b, err_tot, err_norm]=SMSS_hand_derivation(r_e,m_e,a_s,dr,dm)
%% Single Magnet Single Superconductor Hand Derived Linearization
% assume superconductor is at origin (0,0,0)
% inputs: 
% r_e - equilibrium position of magnet 
% m_e - equilibrium orientation of magnet
% a_s - direction normal to superconductor surface
% d_r - translational displacement of magnet position from equilibrium
% d_m - angular displacement of magnet orientation from equilibrium
%% set up geometry of system
mu_0=4*pi*10^-7;    % permeability of free space
% mu=0.8815;          % magnetic field strength of .75 in D N42 spherical NdFeB magnet
% a_s=[0 0 1]';       % superconductor normal
% r_e=[0 0 0.01]';    % position of magnet, separation distance of 1 cm above superconductor
r_fe=(eye(3)-2*(a_s*a_s'))*r_e;  % position of frozen image
r_me=r_fe;          % position of mobile image
% m_e=mu*[0 0 1]';    % orientation of magnet, pointing upward
m_fe=m_e;           % orientation of frozen image
m_me=(eye(3)-2*(a_s*a_s'))*m_e;  % orientation of mobile image
rho_fe=r_e-r_fe;    % equilibrium distance from frozen image to magnet
rho_me=r_e-r_me;    % equilibrium distance from mobile image to magnet
rho_f=rho_fe+dr;  % distance from frozen image to magnet
rho_m=rho_me+2*(a_s*a_s')*dr; % distance from mobile image to magnet
M=27.2e-3*eye(3);   % mass of spherical magnet
I=2/5*M*(0.75*2.54/100)^2;  % inertia of spherical magnet
%% define linearization terms
%define cross terms for simpler syntax later on
rho_fex=crs(rho_fe);
rho_mex=crs(rho_me);
m_ex=crs(m_e);
m_fex=crs(m_fe);
m_mex=crs(m_me);

%the change in equilibrium of the magnet and images
dm_m=(eye(3)-2*(a_s*a_s'))*dm;
drm=2*(a_s*a_s')*dr;

m=m_e+dm;
m_m=(eye(3)-2*(a_s*a_s'))*m;

% superconductor normal
a_sx=a_s(1); a_sy=a_s(2); a_sz=a_s(3);
% equilibrium position
rho_e_x=rho_fe(1); rho_e_y=rho_fe(2); rho_e_z=rho_fe(3);
% equilibrium magnet orientation
m_x=m_e(1); m_y=m_e(2); m_z=m_e(3);
% equilibrium image orientation
m_fx=m_fe(1); m_fy=m_fe(2); m_fz=m_fe(3);
m_mx=m_me(1); m_my=m_me(2); m_mz=m_me(3);
%% graphical representation
% m_xe = [r_e(1) r_e(1)+0.01*m_e(1)/norm(m_e)];
% m_ye = [r_e(2) r_e(2)+0.01*m_e(2)/norm(m_e)];
% m_ze = [r_e(3) r_e(3)+0.01*m_e(3)/norm(m_e)];
% m_m_xe = [r_me(1) r_me(1)+0.01*m_me(1)/norm(m_me)];
% m_m_ye = [r_me(2) r_me(2)+0.01*m_me(2)/norm(m_me)];
% m_m_ze = [r_me(3) r_me(3)+0.01*m_me(3)/norm(m_me)];
% m_f_xe = [r_fe(1) r_fe(1)+0.01*m_fe(1)/norm(m_fe)];
% m_f_ye = [r_fe(2) r_fe(2)+0.01*m_fe(2)/norm(m_fe)];
% m_f_ze = [r_fe(3) r_fe(3)+0.01*m_fe(3)/norm(m_fe)];
% 
% figure
% scatter3(r_e(1),r_e(2),r_e(3),300,[1 0 0],'filled')
% hold on
% scatter3(r_me(1),r_me(2),r_me(3),300,[0 1 0],'filled')
% scatter3(r_fe(1),r_fe(2),r_fe(3),300,[0 1 1],'filled')
% line([0 .02],[0 0],[0 0],'LineWidth',2,'Color',[1 0 1])
% line([0 0],[0 .02],[0 0],'LineWidth',2,'Color',[0 0 1])
% line([0 0],[0 0],[0 .02],'LineWidth',2,'Color',[0 0 0])
% line(m_xe,m_ye,m_ze,'LineWidth',2,'Color',[1 0 0])
% line(m_m_xe,m_m_ye,m_m_ze,'LineWidth',2,'Color',[0 1 0])
% line(m_f_xe,m_f_ye,m_f_ze,'LineWidth',2,'Color',[0 1 1])
% [X,Y] = meshgrid(-.1:.005:.1);
% M=mesh(X,Y,zeros(length(X),length(Y)));
% set(M,'facealpha',0)
% set(M,'edgecolor',[.7 .7 .7])
% axis(.5*[-.1 .1 -.1 .1 -.1 .1])
% view(5,10);
% legend('magnet','mobile image','frozen image','x','y','z')
%% find nonlinear forces
% force at equilibrium should be \vec{0}
% term by term components of force from images
% F_fe_comp=3*mu_0/(4*pi*norm(rho_fe)^5)*[...
%     cross(cross(rho_fe,m_e),m_fe),...
%     cross(cross(rho_fe,m_fe),m_e),...
%     -2*rho_fe*dot(m_e,m_fe),...
%     5*rho_fe/norm(rho_fe)^2*(dot(cross(rho_fe,m_e),cross(rho_fe,m_fe)))];
% F_me_comp=3*mu_0/(4*pi*norm(rho_me)^5)*[...
%     cross(cross(rho_me,m_e),m_me),...
%     cross(cross(rho_me,m_me),m_e),...
%     -2*rho_me*dot(m_e,m_me),...
%     5*rho_me/norm(rho_me)^2*(dot(cross(rho_me,m_e),cross(rho_me,m_me)))];
F_fe_comp=3*mu_0/(4*pi*norm(rho_fe)^5)*[...
    rho_fe*dot(m_e,m_fe),...
    m_e*dot(rho_fe,m_fe),...
    m_fe*dot(rho_fe,m_e),...
    -5/norm(rho_fe)^2*rho_fe*dot(rho_fe,m_e)*dot(rho_fe,m_fe)];
F_me_comp=3*mu_0/(4*pi*norm(rho_me)^5)*[...
    rho_me*dot(m_e,m_me),...
    m_e*dot(rho_me,m_me),...
    m_me*dot(rho_me,m_e),...
    -5/norm(rho_me)^2*rho_me*dot(rho_me,m_e)*dot(rho_me,m_me)];
F_e_comp=F_fe_comp+F_me_comp;
% force vectors from images
F_fe=sum(F_fe_comp,2);
F_me=sum(F_me_comp,2);
F_e=sum(F_e_comp,2);
%force at small displacement should be restorative


% F_f_comp=3*mu_0/(4*pi*norm(rho_f)^5)*[...
%     cross(cross(rho_f,m),m_fe),...
%     cross(cross(rho_f,m_fe),m),...
%     -2*rho_f*dot(m,m_fe),...
%     5*rho_f/norm(rho_f)^2*(dot(cross(rho_f,m),cross(rho_f,m_fe)))];
% F_m_comp=3*mu_0/(4*pi*norm(rho_m)^5)*[...  
%     cross(cross(rho_m,m),m_m),...
%     cross(cross(rho_m,m_m),m),...
%     -2*rho_m*dot(m,m_m),...
%     5*rho_m/norm(rho_m)^2*(dot(cross(rho_m,m),cross(rho_m,m_m)))];
F_f_comp=3*mu_0/(4*pi*norm(rho_f)^5)*[...
    rho_f*dot(m,m_fe),...
    m*dot(rho_f,m_fe),...
    m_fe*dot(rho_f,m),...
    -5/norm(rho_f)^2*rho_f*dot(rho_f,m)*dot(rho_f,m_fe)];
F_m_comp=3*mu_0/(4*pi*norm(rho_m)^5)*[...
    rho_m*dot(m,m_m),...
    m*dot(rho_m,m_m),...
    m_m*dot(rho_m,m),...
    -5/norm(rho_m)^2*rho_m*dot(rho_m,m)*dot(rho_m,m_m)];
F_comp=F_f_comp+F_m_comp;
% force vectors from images
F_f=sum(F_f_comp,2);
F_m=sum(F_m_comp,2);
F=sum(F_comp,2);

% difference in force between equilibrium and displacement
dF_f_comp=F_f_comp-F_fe_comp;
dF_m_comp=F_m_comp-F_me_comp;
dF_f=sum(dF_f_comp,2);
dF_m=sum(dF_m_comp,2);
dF=F-F_e;
dF_comp=F_comp-F_e_comp;
%% find linearized forces

dF_f_lin_drnorm=3*mu_0/(4*pi)*...
    -5/norm(rho_fe)^7*(rho_fe*m_e'*m_fe + m_e*rho_fe'*m_fe + m_fe*rho_fe'*m_e ...
        -5/norm(rho_fe)^2*(rho_fe*rho_fe')*m_e*rho_fe'*m_fe)*rho_fe'*dr;
    
dF_f_lin_drmat=3*mu_0/(4*pi*norm(rho_fe)^5)*(...
    (m_fex*m_ex+m_ex*m_fex-2*m_e'*m_fe*eye(3)-5/norm(rho_fe)^2*(rho_fe*(rho_fex*m_fe)'*m_ex...
    -rho_fe*(rho_fex*m_e)'*m_fex+(rho_fex*m_e)'*(rho_fex*m_fe)))*dr+...
    (-m_fex*rho_fex+crs(rho_fex*m_fe)-2*rho_fe*m_fe'+5/norm(rho_fe)^2*rho_fe*(rho_fex*m_fe)'*rho_fex)*dm);

% dF_f_comp_lin=3*mu_0/(4*pi*norm(rho_fe)^5)*[...
%     -m_fex*rho_fex*dm + m_fex*m_ex*dr,...
%     crs(rho_fex*m_fe)*dm + m_ex*m_fex*dr,...
%     -2*(m_e'*m_fe*eye(3)*dr + rho_fe*m_fe'*dm),...
%     5/norm(rho_fe)^2*(rho_fe*(rho_fex*m_fe)'*rho_fex*dm-rho_fe*(rho_fex*m_fe)'*m_ex*dr...
%         - rho_fe*(rho_fex*m_e)'*m_fex*dr +(rho_fex*m_e)'*(rho_fex*m_fe)*eye(3)*dr)];

dF_f_comp_lin=3*mu_0/(4*pi*norm(rho_fe)^5)*[...
    m_e'*m_fe*eye(3)*dr + rho_fe*m_fe'*dm,...
    m_e*m_fe'*dr + rho_fe'*m_fe*dm,...
    m_fe*m_e'*dr + m_fe*rho_fe'*dm,...
    -5/norm(rho_fe)^2*(((rho_fe'*m_e)*(rho_fe'*m_fe)*eye(3)+...
        (rho_fe'*m_fe)*rho_fe*m_e' + (rho_fe'*m_e)*rho_fe*m_fe')*dr +...
        rho_fe'*m_fe*rho_fe*rho_fe'*dm)];
dF_f_comp_lin=[dF_f_comp_lin dF_f_lin_drnorm];

dF_f_lin= sum(dF_f_comp_lin,2);

dF_m_lin_drnorm=3*mu_0/(4*pi)*...
    -5/norm(rho_me)^7*(rho_me*m_e'*m_me + m_e*rho_me'*m_me + m_me*rho_me'*m_e ...
        -5/norm(rho_me)^2*(rho_me*rho_me')*m_e*rho_me'*m_me)*rho_me'*2*(a_s*a_s')*dr;
    
dF_m_lin_drmat=3*mu_0/(4*pi*norm(rho_me)^5)*(...
    (m_mex*m_ex+m_ex*m_mex-2*m_e'*m_me*eye(3)-5/norm(rho_me)^2*(rho_me*(rho_mex*m_me)'*m_ex...
    -rho_me*(rho_mex*m_e)'*m_mex+(rho_mex*m_e)'*(rho_mex*m_me)))*(2*(a_s*a_s'))*dr+...
    (-m_mex*rho_mex+crs(rho_mex*m_me)-2*rho_me*m_me'+5/norm(rho_me)^2*rho_me*(rho_mex*m_me)'*rho_mex...
    +(crs(rho_mex*m_e)-m_ex*rho_mex-2*rho_me*m_e'+5/norm(rho_me)^2*rho_me*(rho_mex*m_e)'*rho_mex))*...
    (eye(3)-2*(a_s*a_s'))*dm);
    
% dF_m_comp_lin=3*mu_0/(4*pi*norm(rho_me)^5)*[...
%     crs(rho_mex*m_e)*dm_m + -m_mex*rho_mex*dm + m_mex*m_ex*drm,...
%     crs(rho_mex*m_me)*dm + -m_ex*rho_mex*dm_m + m_ex*m_mex*drm,...
%     -2*(m_e'*m_me*eye(3)*drm + rho_me*m_e'*dm_m + rho_me*m_me'*dm),...
%     5/norm(rho_me)^2*(rho_me*(rho_mex*m_me)'*rho_mex*dm-rho_me*(rho_mex*m_me)'*m_ex*drm...
%         +rho_me*(rho_mex*m_e)'*rho_mex*dm_m - rho_me*(rho_mex*m_e)'*m_mex*drm...
%         +(rho_mex*m_e)'*(rho_mex*m_me)*eye(3)*drm)];
dF_m_comp_lin=3*mu_0/(4*pi*norm(rho_me)^5)*[...
    m_e'*m_me*eye(3)*drm + rho_me*m_me'*dm + rho_me*m_e'*dm_m,...
    m_e*m_me'*drm + rho_me'*m_me*dm + m_e*rho_me'*dm_m,...
    m_me*m_e'*drm + m_me*rho_me'*dm + rho_me'*m_e*eye(3)*dm_m,...
    -5/norm(rho_me)^2*(((rho_me'*m_e)*(rho_me'*m_me)*eye(3)+...
        (rho_me'*m_me)*rho_me*m_e' + (rho_me'*m_e)*rho_me*m_me')*drm +...
        rho_me'*m_me*rho_me*rho_me'*dm + ...
        rho_me'*m_e*rho_me*rho_me'*dm_m)];
dF_m_comp_lin=[dF_m_comp_lin dF_m_lin_drnorm];

dF_m_lin= sum(dF_m_comp_lin,2);

dF_lin= dF_m_lin + dF_f_lin;
%% Jacobian for force

